import { Col, DatePicker, Row } from "antd";
import React from "react";
function Dashboard() {
  const { RangePicker } = DatePicker;

  return (
    <div className="dashboard">
      <Row className="dashboard-first">
        <div>
          <Col span={6} className="dashboard-border-first">
            <RangePicker />
          </Col>
        </div>
        <Col span={8} className="dashboard-border-first">
          All Corps - Cost Centers selected
        </Col>
        <Col span={8} className="dashboard-border-first">
          20 Vendors selected
        </Col>
      </Row>
    </div>
  );
}
export default Dashboard;
